function App() {
  const { store, persistor } = getSagaStore();
  return (
      <Provider store={store}>
        <PersistGate persistor={persistor}>

          <BrowserRouter >
            <Switch>
              <Route component={FallTeams} path="/" exact/>
              <Route component={Fprofile} path="/profile"/>
              <Route component={FallTeamInfo} path="/players"/>
            </Switch>
          </BrowserRouter>
        </PersistGate>
      </Provider>
  );
}

export default App;
